  return Promise.allSettled([signUpUser(firstName, lastName), uploadPhoto(fileName)])
    .then((result) => {
      const array = [];
      result.forEach((index) => {
        if (index.status === 'fulfilled') {
          array.push({
            status: index.status,
            value: index.value,
          });
        } else {
          array.push({
            status: index.status,
          	reason: index.reason,
	  });
        }
      });
      return array;
    }).catch((error) => {
      console.error(error);
    });
}

